Hello I have numerous bricks (500-555 rounds) of .22 long rifle ammo (Remington, Winchester and Federal) I am willing to trade towards or for the following:

1. Browning Takedown 22;
2. Browning Buckmark Bullseye Stainless;
3. Marlin 1894CSS (stainless lever .357); or
4. Colt Magnum Carry. 

I am aware of the difficulty in obtaining .22 ammo, but am only interested in trading for the above listed make and model guns. This ammo is not for sale. Please let me know if you have one of these you might be interested in trading and we can see if we can make a deal. Thank you for your time.
